import React from 'react';

const Header = () => {
  return (
    <header className="header">
      <div className="absolute inset-0 -z-10 bg-cover bg-center" style={{ backdropFilter : 'blur'}}></div>
      <nav className="flex space-x-4">
        <button  className="text-white font-semibold hover:underline">Home</button>
        <button  className="text-white font-semibold hover:underline">About</button>
        <button className="text-white font-semibold hover:underline">Resume</button>
      </nav>
    </header>
  );
};

export default Header;
